import React from "react";
import Figure from 'react-bootstrap/Figure';

function ServicesPage() {
  return (
    <Figure>
    <Figure.Image
      width={171}
      height={180}
      alt="171x180"
      src="holder.js/171x180"
    />
     <Figure.Caption>
     <b>
   I am here to provide web development services and create personal websites for individuals, company websites, and websites for restaurants, hotels, and gyms using the latest available technologies. I can offer a wide range of services including:

Designing and developing custom websites tailored to your individual needs and requirements.
Enhancing user experience and designing innovative and attractive user interfaces.
Integrating external systems and applications such as Content Management Systems (CMS), e-commerce, payment systems, and Application Programming Interfaces (APIs).
Developing mobile applications compatible with smartphones and tablets.
Improving Search Engine Optimization (SEO) to increase your online visibility and enhance your website's presence in search results.
Analyzing and monitoring website performance, optimizing page loading speed, and overall page performance.
Providing website hosting services and domain management.
By utilizing these advanced technologies, I will work towards delivering a sophisticated and high-quality website that meets your needs and contributes to your digital success.
   </b>
      </Figure.Caption>
    </Figure>
    
//     <div style={{ color: "#fff" }}>

//     </div>
  );
}

export default ServicesPage;
